import React from "react";
import { Typography } from "@material-ui/core";
import Job from "./Job";

const Jobs = (jobs) => {
    console.log(jobs);
    return (
        <div className="jobs">
            <Typography variant="h1">
                Entry Level Software Jobs
            </Typography>
            {
                jobs.map(
                    job => console.log()
                )
            }
        </div>
    );
};
export default Jobs;
